import React from 'react';

function TableRow(props) {
  return (
    <div>
      <tr style={{ float: 'right'}}>
        <td>
          <img src={props.imageURL} alt="" />
        </td>
        <td>{props.name}</td>
        <td>{props.phone}</td>
        <td>{props.email}</td>
      </tr>
    </div>
  );
}

export default TableRow;
